import React from 'react';
import App from "../App";

class InfosClient extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            client: props.client,
        }
    }

    render() {
        return (
            <section  className="client">
                <label>{this.state.client}</label>
                <input type="text" list="cars" />
                <datalist id="cars">
                    
                </datalist>
            </section>
        )
    }
}

export default InfosClient;
